expressionInfos.expression:
var c = $feature.cid
var p = $feature.partyNumber
var v = $feature.victimNumber
var ct = $feature.city
var dt = Text($feature.dateDatetime, 'M/D/YYYY H:m A')
var exp1 = "Crash ID: " + c + ", Party: " + p + ", Victim: " + v + " | Date: " + dt + ", " + ct
var exp2 = "Crash ID: " + c + ", Party: " + p + ", No Victim | Date: " + dt + ", " + ct
if(!isEmpty(p) && !isEmpty(v)){
    return exp1
} else if(!isEmpty(p) && isEmpty(v)){
    return exp2
}
